import React from 'react';
import styled from 'styled-components';

const HeroSection = styled.section`
  display: flex;
  padding: 40px;
  align-items: center;
  background: #f9f9f9;
`;

const Text = styled.div`
  flex: 1;
`;

const Title = styled.h1`
  font-size: 36px;
`;

const Subtitle = styled.p`
  font-size: 18px;
  margin: 20px 0;
`;

const Button = styled.button`
  padding: 12px 24px;
  font-size: 16px;
  cursor: pointer;
`;

const Image = styled.img`
  flex: 1;
  max-width: 35%;
  border-radius: 12px;
`;

export default function Hero() {
  return (
    <HeroSection>
      <Text>
        <Title>Psicologia e Neuropsicologia</Title>
        <Subtitle>
          Dedicamo-nos a promover o bem-estar e saúde mental através de uma abordagem integrada e personalizada para cada paciente.
        </Subtitle>
        <Button>Agende sua consulta</Button>
      </Text>
      <Image src="/img/75a1c5b0-36e7-429a-bbe0-474d60b94259.jpg" alt="Consultation" />
    </HeroSection>
  );
}
